<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Morada de Piat√£ - Consulta de Vaga de Garagem</title>
  <link rel="stylesheet" href="style.css">
  <link rel="icon" type="image/png" href="img/favicon.png">
</head>

<div id="tooltipVaga" class="tooltip hidden"></div>

<body>

<header class="topbar">
  <div class="topbar-content">
    <img src="img/moradadepiata.png" alt="Condom√≠nio Morada de Piat√£" class="logo">
    <div class="topbar-text">
      <h1>Morada de Piat√£</h1>
      <span>Consulta de Vaga de Garagem</span>
    </div>
  </div>
  <div class="topbar-line"></div>
</header>

<main class="container">

  <!-- üîπ CARD 1 - TIPO DE CONSULTA -->
  <section class="card" id="cardTipoConsulta">
    <h2>Tipo de Consulta</h2>

    <div class="actions tipo-consulta-actions">
      <button id="btnConsultaTorre">Consulta por Torre e Apartamento</button>
      <button id="btnPesquisarMapa">Pesquisar no Mapa</button>
    </div>
  </section>


  <!-- üîπ CARD 2 - CONSULTA POR TORRE -->
  <section class="card hidden" id="cardConsulta">
    <h2>Informe os dados abaixo</h2>

    <form id="consultaForm" class="form-grid">
      <div class="field">
        <label for="torre">Torre</label>
        <select id="torre">
          <option value="">Selecione</option>
          <option value="1">Torre 1</option>
          <option value="2">Torre 2</option>
          <option value="3">Torre 3</option>
          <option value="4">Torre 4</option>
          <option value="5">Torre 5</option>
        </select>
      </div>

      <div class="field">
        <label for="apto">Apartamento</label>
        <select id="apto" disabled>
          <option value="">Selecione</option>
        </select>
      </div>

      <div class="actions">
        <button type="submit">Consultar</button>
      </div>
    </form>

    <div id="resultado" class="resultado"></div>
  </section>


  <!-- üîπ CARD 3 - MAPA LIVRE -->

  <h2>Pesquisar no Mapa</h2>

    <div class="mapa-wrapper">
